import React from 'react';
import '../C_login/style_login.css';
import icon_email from '../C_login/icons/icon_email';
function Password() {
  
    return (    
      <div class="login_password"> 
        <img src={icon_email} className="AU-logo" alt="logo" />
        <input type="password" id="passwordId" placeholder="Enter your password"></input>                
      </div>
    );
  }
  
  export default Password;
